import "./styles.css";
export default function Intro() {
    return (
        <div>
            <h1>Welcome to our React Application</h1>
            <p>This is a simple React application.</p>
            <p>To get started, click on a button below:</p>
            <button onClick={() => alert("Hello, World!")}>Click me!</button>
        </div>
    )
}
